import React from "react";
import { Row, Col } from "antd";

const Story = () => {
  return (
    <div className="story">
      <Row gutter={24}>
        <Col sm={24} lg={6}>
          <div className="story-details"></div>
        </Col>
        <Col sm={24} lg={18}>
          <div className="story-chapters"></div>
        </Col>
      </Row>
    </div>
  );
};

export default Story;
